(163439, 'AECFEBA3-3DED-40D4-83A6-CB97D88EDB9E', 'Hi sweet baby. I just want you to know that I know this is a tricky and tough time for you and your kids. You''re a champ for taking it on. Nathan is tough. But finding him help so that he can move through this is super important, albeit it painful. The path of least resistance is to simply let him keep going as is. But ultimately, that would hold him back in the long run. I love you and applaud you for having the strength and courage to take it on. Love you my sweets.', '476217354000000000', '476219690000000000', 0, 'Nitzan', 'David', 0, '', '', '', 'iMessage', 'None', 'nitzan.pelman@gmail.com', '2016-02-03T10:35:54'),
