(163462, '014D10B4-684F-4CC0-8967-A8A28C1965D7', 'Hey love. Thanks for the encouragement. I know this is all true. There still is a lot of change/adjustment for everyone and it feels disorienting sometimes. I''m happy about the new patterns we are starting to establish. I know you have lots of competing priorities right now and I appreciate your help with the boys. They do ask nightly, ''where is Nitzan?'' I think it feels more like a complete family to all of us when you are with us at night and for dinner. These are some of the rituals...like family dinner time...that i miss and am trying to figure out how to just move on to whatever we create together. ', '476220574000000000', '476222262000000000', 1, 'David', 'Nitzan', 0, '', '', '', 'iMessage', 'None', 'David', '2016-02-03T11:29:34'),
(163469, '7B18C20A-8B2B-4C63-A1AF-EBC4E971FDF9', 'Hey babe. I hear you on family dinner time. I‚Äôve been operating solo for so long that I haven‚Äôt exactly figured out the right balance of family time at home. When you made plans with Ellen this weekend, I cancelled my plans. ', '476222556000000000', '476223005000000000', 0, 'Nitzan', 'David', 0, '', '', '', 'iMessage', 'None', 'nitzan.pelman@gmail.com', '2016-02-03T12:02:36'),
(163449, 'CC28E62A-02C7-4DF0-8B8F-6FF6BEA5AD99', 'Next week, I don‚Äôt have any evening events as of yet. Because I don‚Äôt get invited to lots of things, I have been accepting offers when I do get invitations. But I can figure out a better balance if the time away doesn‚Äôt feel right. In addition to family, I need outlets for friendship and mental stimulus. Our conversations feel pretty operational lately or entirely focused on your kids (which is totally sensical because we just moved and your kids are in need of a lot of attention and discussion ‚Äî so none of this is a complaint). But I‚Äôm starting to really crave the mental stimulus and have been getting some of it when I leave our home. Now that we‚Äôve moved in and are getting more settled, can we try to find ways to bring more ideas and richer dialoh into our lives. I know this is something that you want to, so this isn‚Äôt a complaint but something that I‚Äôve been struggling with lately. ', '476222928000000000', '476223005000000000', 0, 'Nitzan', 'David', 0, '', '', '', 'iMessage', 'None', 'nitzan.pelman@gmail.com', '2016-02-03T12:08:48'),
(163366, '978DCABD-AA71-4805-AA7D-0DCB126CCC25', 'I get it. These are good tensions actually and I‚Äôm not trying to push you to do less or accept fewer invitations...I just want you to know how much I value it when we are together at home. Right now is pretty acute....moving is a big change, Marla disappearing and me being full-time dad is a big change, and us moving in together (while it just feels natural and awesome) is also a big change. I feel lucky that I have mental stimulation in such a big way at work, but lets make a point of doing more together on that front....one suggestion...lets do one of the events with Farai....think the topic of her book is super interesting, and she is great. ', '476223553000000000', '476223559000000000', 1, 'David', 'Nitzan', 0, '', '', '', 'iMessage', 'None', 'David', '2016-02-03T12:19:13'),
(163285, 'C256DC0E-E4B3-4E20-A8E6-E829B6DF0FB0', 'I‚Äôm used to men in my life bringing ideas and topics to our dynamic. We did more of this in the earlier part of our relationship but it feels like we‚Äôve fallen out of the habit. When I‚Äôm with Oliver and Noah, we sometimes debate what‚Äôs happening with privacy in this country. When I was with Brandon from Standford (candidate I was cultivating) this week, we had a really deep conversation about the meaning of education and some of the complexities of my company. And how all of that will play into the next 10-20 years of higher ed as the future of work changes. I‚Äôd love that you feel so stimulated at work and I would be grateful if you brought some of that into our life. I don‚Äôt always know what to ask you about, but I‚Äôm endlessly curious and so if you bring up ideas, I will run with them. It‚Äôs the trademark of every friendship I have. There‚Äôs a national election, there‚Äôs Black Lives Matter, which I care about more and more these days. The police dept in SF is undergoing review by the federal courts for misconduct. We‚Äôre kinda letting these things pass us by.¬†¬†Events are great and I‚Äôd love to go to anything with Farai ‚Äî so feel free to buy us tickets to anything. But, I‚Äôm also hoping we can find ways to make it more about our daily interactions ‚Äî the ride over to Ikea, while we‚Äôre unpacking boxes‚Ä¶it‚Äôs why I love podcasts. Cause it gives me new fodder to think about all the time.¬†¬†', '476224193000000000', '476224472000000000', 0, 'Nitzan', 'David', 0, '', '', '', 'iMessage', 'None', 'nitzan.pelman@gmail.com', '2016-02-03T12:29:53'),
